INSERT INTO `aboutus` (`id`, `about`, `abouta`, `whoweare`, `whatwedo`, `ourmission`) VALUES
(1, '<h1>Weâ€™re Helping <strong>AFRICANS</strong> Find Great Jobs, and Helping Employers Build Great Companies</h1>', 'There are no secrets to success. It is the result of preparation, hard work, and learning from failure.\" ~ Colin Powell.', 'We create and deliver the best recruiting media, technologies and platforms for connecting jobs and AFRICANS; we strive every day to help our customers hire and help AFRICANS find jobs.', 'Africa Global Network (AGN), Inc., is a global leader in connecting AFRICANS around the world to jobs, wherever they are. AGN has helped people improve their lives with better jobs, and employers find the best talent. Today, the company offers services in all countries you can see Africans, providing some of the broadest, most sophisticated job seeking, career management, recruitment and talent management capabilities. AGN continues its pioneering work of transforming the recruiting industry with advanced technology using intelligent digital, social and mobile solutions, including our website africaglobalnetwork.com and a vast array of products and services.\r\n', 'Our mission is to help AFRICANS find meaningful employment\r\n');
