INSERT INTO `blog` (`id`, `blog_img`, `blog_title`, `blog_content`, `blog_date`, `blog_status`) VALUES
(11, 'img83910.jpg', 'The secret of success', '<p>The secret of success is not just one factor. The secret of success (if there is one) is a<br>combination of good habits, a tenacious spirit, and a lot of luck. Bringing conscious changes in<br>your behavior and attitude can lead you to success.<br>Discover all the secrets that will help you transform and improve your life in order to reap the<br>rewards of success beyond your expectations. If you have stopped setting goals and the future<br>does not make you dream, then inspire these five keys to success and quickly find hope! Putting<br>an end to bad attitudes<br><strong>1- Stop procrastinating.</strong><br>Avoiding the unpleasant tasks of your job will not remove them. Instead, divide the complex<br>tasks into easily manageable steps, then integrate lightly the aspects of the unpleasant tasks to<br>the tasks you like to do. Do not accumulate unpleasant tasks to achieve them after performing<br>pleasant tasks, otherwise you will keep a bitter taste or negative feeling at the end of the project.<br><strong>2- Fight the negativity.</strong><br>Understand that the path to success is not an endless path of continuous happiness. This path<br>is strewn with difficulties, failures, and moments when your commitment could be challenged.<br>You will encounter obstacles, regardless of whether you are on the right or wrong path. So,<br>although this can be sometimes difficult, you have to make an effort to stay positive, as you<br>were at the beginning of the project.<br><strong>3- Do not compare yourself to others.</strong><br>Do not define your position in relation to the success of others, otherwise you will lose sight of<br>your own goals and merits, and this can lead to feelings of inferiority, bitterness and jealousy.<br>Competition is a good thing, but focusing too much on others can cause you to develop bad<br>attitudes.<br><strong>4- Kiss the failure.</strong><br>It always reveals a truth about the methods used and the specific objectives pursued. Do not<br>interpret failure as a shame, but as a call to self-reflection. Sometimes it is only by facing the<br>insurmountable, the failure, and struggling to recover yourself that you will develop the tenacity<br>you need to succeed.<br>5<strong>- Focus on the survival of the project.</strong><br>The most important goal when you start a new business, career or project, is survival. Do not<br>set the bar too high by setting unrealistic goals for the nascent business.</p>', '2017-10-10', 1);
