(1, 'Want To Make Professional Resume', 'The best way to create a professional resume that will help you land your dream job, or at least get you one step closer to it.', 'Request for Resume', 'Wait for Approve', 'Approved', 'Thousands of employers search for candidates on Africa Global Network. Make an Professional Resume and get noticed by top employers.', 'Request For Create Resume', 'We create a professional resume that will help you land your dream job, or at least get you one step closer to it,Just Click on Create Resume.', 'Easily Apply For Jobs', 'Apply to jobs from your computer or smartphone in seconds.', 'Get Contacted', 'Post your resume so that employers can contact you about job opportunities.', 'Create An Resume In Minutes', 'Make Your Online Resume', 'The right content on your resume can help you stand out from other candidates, get noticed and demand attention from employers. Check out these best practices that will help you create an effective resume and improve your chances of landing that dream job.', 'MAKE A PROFESSIONAL RESUME TO TARGETED FIND BEST JOBS IN AFRICA GLOBAL NETWORK', 'Make Payment', 'We Build a professional resume for your better future just in $69.99. Pay now to build your resume', 'Disagree', 'Pay');
