(3, 'Client Support Manager', '8103', '<ul>\r\n	<li>Traiter les demandes de client par telephone, courriel,&nbsp;</li>\r\n	<li>francophones et anglophones.</li>\r\n	<li>Faire la facturation aux clients</li>\r\n	<li>Faire le suivi des appels</li>\r\n	<li>Faire le suivi des inventaires</li>\r\n	<li>Effectuer les op&eacute;rations de commandes, retours pour les clients.</li>\r\n	<li>S&#39;assurer de r&eacute;pondre aux demandes des clients</li>\r\n	<li>Bilingue (OPTIONEL FRANCAIS-ANGLAIS)</li>\r\n	<li>Avoir un sens de l&rsquo;analyse d&eacute;velopp&eacute;</li>\r\n	<li>Polyvalent (multit&acirc;che)</li>\r\n	<li>G&eacute;rer le stress</li>\r\n	<li>&Ecirc;tre motiv&eacute;, d&eacute;montrer de l&#39;initiative</li>\r\n	<li>Communiquer clairement et efficacement</li>\r\n	<li>Interagir avec le client pour r&eacute;pondre &agrave; ses demandes</li>\r\n	<li>Connaissance de l&rsquo;environnement internet</li>\r\n</ul>\r\n', ' Customer service', 'Full Time', '1 Year', 'FCFA', '100000 - 150000', 'software,laravel,html', '32', '2017-10-10 10:14:04pm', '2022-02-28', 1, 1, 1, 23),
