(7, 'job post ', '2707', '<p><em>Embass y of </em>the <em>Republic of Benin To </em>the <em>United of America</em></p>\r\n\r\n<p><em>2124 Kalorama Road, N.W. </em>lVnshin9ton, <em>D. </em><em>C, </em><em>20008 </em>wmm. <em>beninembassy. us</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Te/:&nbsp; <em>(202) </em><em>282-6656</em></p>\r\n\r\n<p><em>(202) </em><em>2:32-665T</em></p>\r\n\r\n<p><em>(202) </em><em>282-261 </em><em>1</em></p>\r\n\r\n<p><em>Fax:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><em>[202</em><em>) </em><em>265&mdash;1996</em></p>\r\n\r\n<p>E&mdash;mnif- <a href=\"mailto:info@beninembnssy.us\"><em>info@beninembnssy.us</em></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"file:///C:UsersadminAppDataLocalTempmsohtmlclip1\01clip_image006.gif\" style=\"height:90px; width:103px\" />AVIS DE RECRUTEMENT</p>\r\n\r\n<p>L&rsquo;Ambassade du B&eacute;nin a Washington DC recherche de toute urgence pour&nbsp; un contrat de deux (02) ans renouvelable&nbsp; une fois:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Un ou une Secr&eacute;taire &mdash; r&eacute;ceptionniste</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Conditions a remplir</p>\r\n\r\n<p>Etre ag&eacute; d&rsquo;au moins 18 ans; Etre de nationalit&eacute; b&eacute;ninoise;</p>\r\n\r\n<p>Etre l&eacute;galement install&eacute; aux Etats Unis d&rsquo;Am&eacute;rique;</p>\r\n\r\n<p>Etre titulaire au minimum d&#39;un baccalaur&eacute;at ou de tous autres diplomes Equivalents</p>\r\n\r\n<p>Etre bilingue (Anglais ct Fran9ais)</p>\r\n\r\n<p>Avoir une bonne maitrise de l&rsquo;outil informatique Jouir d&rsquo;une bonne sant&eacute; mentale et physique</p>\r\n\r\n<p>Une experience dans la tenue du secretariat est exig&eacute;e.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pi&eacute;ces&nbsp; a fournir</p>\r\n\r\n<p>Une demande adress&eacute;e a l&rsquo;Ambassadeur du B&eacute;nin pres les Etats Unis d&rsquo;Am&eacute;rique</p>\r\n\r\n<ul>\r\n	<li>une copie d&#39;acte de naissance l&eacute;galis&eacute;e; quatre (04) photos d&#39;identit&eacute;;</li>\r\n	<li><img src=\"file:///C:UsersadminAppDataLocalTempmsohtmlclip1\01clip_image008.jpg\" style=\"height:74px; width:32px\" />une fiche m&eacute;dicale diiment sign&eacute;e d&#39;un m&eacute;decin agr&eacute;&eacute; attestant que l&#39;agent est indemne de toute maladie contagieuse et de&nbsp; tout ant&eacute;c&eacute;dent avant son recrutement;</li>\r\n</ul>\r\n\r\n<p>une piece d&#39;identit&eacute; b&eacute;ninoise en cours de validit&eacute;;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"file:///C:UsersadminAppDataLocalTempmsohtmlclip1\01clip_image009.gif\" style=\"height:2px; width:52px\" />un curriculum vitae;</p>\r\n\r\n<p>une copie l&eacute;galis&eacute;e du diplome; un caster judiciaire;</p>\r\n\r\n<p>un engagement a servir le B&eacute;nin avec loyaut&eacute; pendant la dur&eacute;e du contrat.</p>\r\n\r\n<p>Les personnes int&eacute;ress&eacute;es par le pr&eacute;sent avis sont pri&eacute;es de faire parvenir leurs dossiers sous plis ferm&eacute;s, portant la mention recrutement au poste de secr&eacute;taire-r&eacute;ceptionniste, adress&eacute;s a l&#39;Anabassadeur du B&eacute;nin a Washington DC au plus tard Ie vendredi 15 d&eacute;cembre 2017.</p>\r\n\r\n<p><!--![endif]----></p>\r\n', ' Customer service', 'Full Time', '2 Year', '$', '2000', 'software,laravel,html', '2', '2017-11-16 05:38:51am', '2021-11-30', 0, 0, 1, 101),
(8, 'full stack developer', '780', '<p><span style=\"color: rgb(51, 62, 73); font-family: proxima-nova, helvetica, arial, sans-serif; font-size: 24px; text-align: center; background-color: rgb(240, 240, 251);\">A Full-Stack developer is a professional responsible for working on both front-end and back-end development processes. They design, develop, and maintain fully-fledged and functioning platforms with databases or servers. These servers do not need other third-party applications to build an entire system from scratch.</span></p>\r\n', 'Web Development', 'Full Time', 'Fresher', '', '20,000 +', 'php html css java python', '2', '2024-04-10 08:46:27am', '2024-10-10', 0, 0, 1, 101),
(9, 'pHP DEVELOPER', '783', '<ol>\r\n	<li>\r\n	<p><strong>Job Title</strong>: This typically includes the position&#39;s title, such as &quot;PHP Developer,&quot; &quot;PHP Engineer,&quot; or &quot;Web Developer.&quot;</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Job Description</strong>: This section outlines the responsibilities and duties of the role. It might include tasks such as developing server-side logic, integrating user-facing elements with server-side logic, building efficient, testable, and reusable PHP modules, solving complex performance problems and architectural challenges, etc.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Skills and Qualifications</strong>: This part specifies the technical skills, qualifications, and experience required for the position. For a PHP job, this often includes proficiency in PHP programming, understanding of MVC design patterns, experience with PHP frameworks like Laravel, Symfony, or CodeIgniter, familiarity with front-end technologies (HTML, CSS, JavaScript), knowledge of database systems like MySQL or PostgreSQL, experience with version control systems like Git, etc.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Education and Experience</strong>: Some postings may specify the educational background or level of experience required. This could range from a bachelor&#39;s degree in Computer Science or a related field to a certain number of years of professional experience in PHP development.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Additional Preferred Skills</strong>: Employers might list additional skills or experiences that are not mandatory but would be beneficial for the role. This could include knowledge of other programming languages, experience with cloud platforms like AWS or Azure, familiarity with DevOps practices, experience with Agile methodologies, etc.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Location and Work Environment</strong>: Information about whether the position is remote, onsite, or a combination of both, as well as the location of the job.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Company Overview</strong>: Some job postings provide a brief overview of the company, its mission, culture, and values.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Salary and Benefits</strong>: While not always included, some job postings may mention the salary range, benefits package, and any additional perks offered by the employer.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>How to Apply</strong>: Instructions on how to apply for the position, including whether to submit a resume, cover letter, portfolio, or any other required documents, and where to send them (e.g., email address, online application portal).</p>\r\n	</li>\r\n</ol>\r\n', 'Web Development', 'Full Time', 'Fresher', 'iNR', '25000+', 'software,laravel,html,php developer,job', '50', '2024-04-23 12:02:50pm', '2025-02-02', 0, 0, 1, 101),
(10, 'Python Developer', '47612', '<p><strong>ob Title: Python Developer</strong></p>\r\n\r\n<p><strong>Company:</strong> GATEWAY</p>\r\n\r\n<p><strong>Job Description:</strong></p>\r\n\r\n<p>We are seeking a talented Python developer to join our dynamic team. As a Python developer, you will be responsible for developing and maintaining high-quality software applications, contributing to all phases of the development lifecycle. You will work closely with our team of developers, designers, and product managers to create innovative solutions that meet our clients&#39; needs.</p>\r\n\r\n<p><strong>Responsibilities:</strong></p>\r\n\r\n<ul>\r\n	<li>Develop, test, and maintain software applications using Python</li>\r\n	<li>Collaborate with cross-functional teams to define, design, and ship new features</li>\r\n	<li>Write clean, maintainable, and efficient code</li>\r\n	<li>Troubleshoot, debug, and fix issues in existing software applications</li>\r\n	<li>Participate in code reviews and provide constructive feedback to other team members</li>\r\n	<li>Stay up-to-date with emerging technologies and trends in the Python community</li>\r\n</ul>\r\n\r\n<p><strong>Requirements:</strong></p>\r\n\r\n<ul>\r\n	<li>Bachelor&#39;s degree in Computer Science, Engineering, or related field</li>\r\n	<li>Proven experience as a Python developer or similar role</li>\r\n	<li>Strong understanding of software development principles, data structures, and algorithms</li>\r\n	<li>Proficiency in Python and its libraries/frameworks (such as Django, Flask, etc.)</li>\r\n	<li>Experience with relational databases (e.g., PostgreSQL, MySQL) and NoSQL databases (e.g., MongoDB)</li>\r\n	<li>Familiarity with front-end technologies (HTML, CSS, JavaScript) is a plus</li>\r\n	<li>Excellent communication and teamwork skills</li>\r\n	<li>Ability to work independently and manage multiple tasks simultaneously</li>\r\n</ul>\r\n\r\n<p><strong>Benefits:</strong> [Insert information about company benefits, perks, and culture.]</p>\r\n', 'Web Development', 'Full Time', 'Fresher', 'iNR', '25000+', 'pythondeveloper,argenthire,hiring', '51', '2024-04-29 06:03:16pm', '2024-05-02', 0, 0, 1, 101);
INSERT INTO `privacy` (`id`, `content`) VALUES
(1, '<p style=\"font-family: \" open=\"\" sans=\"\">â€‹â€‹AGN (Africa Global Network) maintains a great respect for the privacy and security of our users. We recognize that the reason we can remain in business is because of you. Therefore we will do nothing to jeopardize your trust and loyalty.</p><p style=\"font-family: \" open=\"\" sans=\"\">AGN <span style=\"background-color: rgb(255, 255, 255);\">(Africa Global Network)&nbsp;</span>hosts and manages over 1,000 career Websites on behalf of our Partners. If you visit a career site that is powered by AGN, you may also see our Partnerâ€™s logos, trademarks, and proprietary trade documentation on that Website. We strongly recommend that you also review our Partnerâ€™s Privacy Policy before using the Website. If you disagree with the way we collect, process and display personal and non-personal information on our Websites, do not use them.</p><p style=\"font-family: \" open=\"\" sans=\"\">Although we make every effort to keep information confidential in accordance with the functionality of our Websites, AGN cannot and does not guarantee the security, confidentiality, or privacy of any information or communication that you submit to us.</p><p>AGN <span style=\"background-color: rgb(255, 255, 255);\">(Africa Global Network)</span>&nbsp;has been awarded TRUSTe&nbsp;Privacy Seal signifying that this privacy policy and practices have been reviewed by TRUSTe for compliance with&nbsp;<a data-cke-saved-href=\"http://www.truste.com/privacy_seals_and_services/consumer_privacy/privacy-programs-requirements.html\" href=\"http://www.truste.com/privacy_seals_and_services/consumer_privacy/privacy-programs-requirements.html\">TRUSTe&nbsp;program requirements</a>&nbsp;including transparency, accountability and choice regarding the collection and use of your personal information. The TRUSTe program does not cover information that may be collected through downloadable software. The TRUSTe program covers only information that is collected through this Web site,&nbsp;<a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\">www.AfricaGlobalNetwork.com</a>&nbsp;and does not cover information that may be collected through behind the log in on our website.</p><p>TRUSTe&nbsp;mission, as an independent third party, is to accelerate online trust among consumers and organizations globally through its leading privacy Trustmark and innovative trust solutions<em>. If you have questions or complaints regarding our privacy policy or practices, please contact us at&nbsp;</em><a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">privacy@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a><em>. U.S. - E.U. Privacy Sheild</em></p><p>â€‹</p><p>AGN complies with the EU - U.S. Privacy Shield Framework as set forth by the U.S. Department of Commerce and European Commission regarding the collection, use, retention, and protection of personal information from the European Union member countries. AGN has certified that it adheres to the EU - U.S. Privacy Principles of notice, choice, onward transfer, security, data integrity, access, and enforcement. To learn more about the EU - US Privacy Shield program, please visit&nbsp;<a data-cke-saved-href=\"https://www.commerce.gov/privacyshield\" href=\"https://www.commerce.gov/privacyshield\">https://www.commerce.gov/privacyshield</a>.</p><p><strong>Information Collected by AGN (Africa Global Network)</strong></p><p>Visitors to our Website remain anonymous unless they elect to register an account on our Website, or request information from AGN. We require certain personal information to register accounts as well as respond to your inquiries about our Website and service. This information includes name, email address, phone number, and company physical address. We also collect sensitive information such as credit card number and cvc code to fulfill payment for services purchased on the Website. We also use your personal information to send users surveys. We do not share any of this personal information with third parties for their promotional purposes.</p><p>We reserve the right to disclose information to our services providers. We employ the services of a third party payment processor to fulfill payment on transactions. These companies are authorized to use your personal information&nbsp;<em>only as necessary to provide</em>&nbsp;these services to us. We also reserve the right to share information with law enforcement and government agencies where a formal request has been made such as in a civil suit, court order, subpoena or judicial proceeding, or where necessary in protecting our intellectual property, the safety of our staff, users or the general public. We post testimonials from our usersâ€™ on the Website. These testimonials include user names. We obtain consent to include this information within testimonials prior to posting on the Website. If you wish to update or delete your testimonial, you can contact us at&nbsp;<a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">ClientServ@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a>.</p><p>We send notification emails about the Website and the service from time to time as necessary. Generally, you may not opt-out of these communications, which are not promotional in nature. If you do not wish to receive them, you have the option to deactivate your account.</p><p>We also send newsletters to our users with news of new service offerings and promotions. Should you change your mind about receiving these newsletters, you can unsubscribe by following the directions present in each email we send out.</p><p><br></p><p><strong>EmployAnalytics</strong></p><p>AGNâ€™s EmployAnalytics (\"EA\") service is designed to provide analytical data and statistics to employers that post recruitment advertisements through AGNâ€™s distribution channels. AGN acts as an agent of the employer by collecting user personal and non-personal information during the job application process.</p><p>The EA service uses proxy servers to collect, retain and pass along your information to employers. Our Websites collect information from visitors, including job seekers, employers, recruiters and advertising agencies (\"users\"). AGN may collect personal information about you when you choose to apply to a job through EA. Some examples of personal information that we collect include: your name, address, email address, telephone number, credit card number, contact information, IP address, billing information, profession, work experience, and information about third parties, such as contacts or references that you provide to us.</p><p>This information may be analyzed and used to generate aggregate statistics and to determine use patterns and effective job placement to better serve you in the future. We may also collect behavioral information regarding how you use our sites and the areas of our site that you visit to better serve you in the future.</p><p>All personal information will be processed and stored by AGN in the United States. United States laws regarding processing of personal information may be less stringent than the laws in your jurisdiction.</p><p><strong>How Information is Used by AGN (Africa Global Network)</strong></p><p>AGN collects personal and non-personal information to perform the service of matching job seekers up with potential employers. Our goal is to provide a beneficial and positive experience for all parties using our services. By utilizing our services, you have agreed to allow us to use your information, subject to local law, in the following manner: To create a job seeker profile for you based on information you have provided to us; To provide information about you to employers and recruiters at your request; To create an employer profile based on the information you have provided us; To provide information about you and your recruitment advertisements to job seekers at your request; If an employer uses AGNâ€™s technology to post an advertisement to a third party job board, that employerâ€™s contact information may be shared with the operator of that third party; To contact you regarding changes to your profile, service updates, products and services you may be interested in, surveys, sweepstakes, and various other communications regarding our products and services. We do not sell your personal information to anyone for any reason without your consent. You may elect to opt out of any communications sent to you at any time. job seekers may elect to have their profile and contact information kept private at any time by logging in and changing the setting of their profile. You may request that we change the settings of your profile for you by emailing us at&nbsp;<a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">ClientServ@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a>.</p><p>If you use our service to build or post a resume in our database, you will be providing us with personal information that will be used in accordance with our Privacy Policy.</p><p><strong>EmployAnalytics</strong></p><p>AGN collects personal and non-personal information as part of submitting a job-seeker application to an employer for their online job application process. This information is obtained from the user via proxy server and submitted to the employer at the userâ€™s request and direction. AGN uses this data to conduct various measures of job posting effectiveness, accuracy, posting locations, business intelligence regarding the placement of job advertisements, the content of job advertisements, and the conversion of users from viewing a job advertisement to submitting a completed job advertisement for an open position. Our goal is to provide a beneficial and positive experience for all parties using our services by developing deep insight into the process of matching job seekers with employers through the right job advertisements. By utilizing our services, you have agreed to allow us to use your information, subject to local law, in the following manner: To create a job seeker profile for you based on information you have provided to us; To provide information about you to employers and recruiters at your request; To provide information about you to employers specifically as a part of the interactive job application process; To provide information about you and your application habits to the employers whose job postings you view, follow, or submit jobs through; To create an employer profile based on the information you have provided us; To provide information about you and your recruitment advertisements to job seekers at your request.</p><p>AGN does not disclose personal information to third parties without your consent. If you select a product or service on our site that is offered by one of our affiliates, you may be redirected to that affiliateâ€™s website, and some of your personal information may be provided to that affiliate in order to assist them with the transaction. Please be aware that our Affiliates may use your information consistent with their own Privacy Policy, which may be inconsistent with our Privacy Policy.</p><p>AGN may be required to disclose your personal information to law enforcement officials to cooperate with the law. This disclosure would be to protect the interests of AGN and its users.</p><p><strong>Third Party Sites</strong></p><p>We provide links on our Website to third party sites. These links are provided to visitors and users as a courtesy. We have no authority over, or take responsibility for the information practices of these third party sites and encourage you to review their privacy and information practices prior to disclosing your personal information.</p><p><strong>Security</strong></p><p>AGN will take measures to protect your information from unauthorized or inappropriate use by third parties. AGN integrates with third party software for security reasons such as Google&nbsp;reCAPTCHA service. Information collected by reCAPTCHA is held in accordance with the Google Privacy Policy. AGN has no control over these third parties, so we cannot be responsible for their use of the information. AGN cannot guarantee that your information will always remain private. Our users assume all responsibility and risk for the use of our websites. AGN employs industry accepted standards in protecting your personal information while on our Website. AGN uses 128 bit SSL encryption to manage our payment processing. AGN is compliant with the PCI scan validation requirement. All web site data is hosted and stored in a database of servers in the United States.</p><p><strong>Cookies, Web Beacons and Flash LSOs</strong></p><p>AGN uses cookies for your convenience and security. Cookies are text files stored on your computer. The cookies remember information that youâ€™ve already typed in our web site fields, so you donâ€™t have to enter them again. They are used to make your experience on web sites more personal and less cumbersome. We do link information stored in cookies to personally identifiable information you submit while on our site. You should have the ability to change whether or not cookies are used through your web browser. Please refer to your web browserâ€™s help function for assistance on how to change your preferences. We may also apply the use of web beacons in our email communications and Website from time to time. A web beacon is a one pixel by one pixel image embedded within a web page for page view tracking purposes. Web beacons are not tied to personal information on the Website. Like most other Websites, we also make use of log files which include users IP address, referring URL and pages viewed within a session.</p><p>We use local shared objects, also known as Flash cookies, to store your preferences such as volume control or high game score, or display content based upon what you view on our site to personalize your visit. Third Parties, with whom we partner to provide certain features on our site or to display advertising based upon your Web browsing activity, use Flash cookies to collect and store information.</p><p>Flash cookies are different from browser cookies because of the amount of, type of, and how data is stored. Cookie management tools provided by your browser will not remove Flash cookies. To learn how to manage privacy and storage settings for Flash cookies click here:</p><p><a data-cke-saved-href=\"http://www.macromedia.com/support/documentation/en/flashplayer/help/settings_manager.html#117118\" href=\"http://www.macromedia.com/support/documentation/en/flashplayer/help/settings_manager.html#117118\"><strong>http://www.macromedia.com/support/documentation/en/flashplayer/help/settings_manager.html#117118</strong></a></p><p>If you use our service to build or post a resume in our database, you will be providing us with personal information that will be used in accordance with our Privacy Policy.</p><p><strong>Proxy Server</strong></p><p>AGN uses proxy servers to collect information from job seekers during the EA application process. When a job seeker clicks the \"Apply Here\" link in a job description, they are redirected to the employerâ€™s application page, via AGNâ€™s proxy server. The proxy server collects personal and non-personal information on behalf of the employer. Personal information may include profession, work history, contacts and references. All information gathered is used to improve the job seeker application process. A link to AGNâ€™s Privacy Policy is displayed on the bottom of the page during the proxy server application process.</p><p><strong>Third Party Cookies</strong></p><p>We have third party advertisers on the site who may employ the use of cookies and web beacons on the Website in tracking the effectiveness of their advertisements. We have no access to these third party cookies. We may also employ the services of a third party agent in tracking aggregated statistical data about our Website. This non personal information is used for statistical purposes and these third parties may also employ the use of cookies and web beacons in providing this service to us.</p><p><strong>Behavioral Targeting / Re-Targeting</strong></p><p>We partner with a third party ad network to either display advertising on our Web site or to manage our advertising on other sites. Our ad network partner uses cookies and Web beacons to collect non-personally identifiable information about your activities on this and other Web sites to provide you targeted advertising based upon your interests. If you wish to not have this information used for the purpose of serving you targeted ads, you may opt-out by emailing us at&nbsp;<a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">ClientServ@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a>. Please note this does not opt you out of being served advertising. You will continue to receive generic ads.</p><p><strong>Changes to your Account</strong></p><p>You may update, delete or modify any of the personal information submitted to our Website by sending an email to us at&nbsp;<a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">ClientServ@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a>.</p><p>We will retain your information for as long as your account is active or as needed to provide you services. We will retain and use your information as necessary to comply with our legal obligations, resolve disputes, and enforce our agreements.</p><p><strong>Subject to Change</strong></p><p>The terms and conditions of this Privacy Policy are subject to change at any time by updating this page. Periodically, you should return and review this privacy statement. Any use of the site following the posting of any new or modified privacy agreement constitutes your acceptance of the modified agreement. Should we make any material changes to the manner in which we use your collected information, we shall notify you by means of a prominent notice on the Website, or by email.</p><p>Comments and questions may be sent to:&nbsp;<a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">privacy@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a></p><p>If you encounter a user that is in violation of the terms of this Privacy Policy, or if you believe a user is inappropriately using our services, please email us immediately at&nbsp;<a data-cke-saved-href=\"mailto:privacy@africaglobalnetwork.com\" href=\"mailto:privacy@africaglobalnetwork.com\">privacy@</a><a data-cke-saved-href=\"http://www.africaglobalnetwork.com/\" href=\"http://www.africaglobalnetwork.com/\" style=\"background-color: rgb(255, 255, 255);\">AfricaGlobalNetwork.com</a>. We shall respond to all inquiries within 30 days of receipt.</p><p><br></p><p><br></p>');
