extract protected data.</p><p><strong>Security</strong></p><p>You may not access, collect, record, alter or interfere with account data that does not belong to you. Any attempts or successes at violating another user data or privacy shall result in breach of this usage agreement and may result in criminal or civil proceedings.</p><p><strong>Specific Prohibited Uses</strong></p><p>This site or its services may not be used for any illegal or unlawful purposes. AGN reserves the right to terminate usage by any party that AGN deems questionable.&nbsp;No party may enter data that is knowingly inaccurate, incomplete or false. No party may enter data that does not belong to them. You may not enter data for another user. This shall include, but not be limited to, the listing of job opportunities. You may not post job openings that are not for Your Company. The only exception to this is if you represent an ad agency, recruitment firm, or another third party recruitement service, with permission to post on the company behalf.</p><p>No party may maintain an excessive amount of data on AGN servers or upload anything that may cause excessive strain on AGN systems and networks.</p><p>No party may use the services available on the Career Center for any purpose other than their intended uses. This shall include, but not be limited to, the practice of posting openings that do not specifically exist for the purpose of collecting resumes or other data from our users. This practice is explicitly restricted and may result in cancellation of your posting and removal of your usage rights.</p><p>No party may use our services with the intent of hurting, damaging, destroying, or otherwise infringing on the stability and usefulness of AGNâ€™s services</p><p>AGN reserves the right to alter, edit, or remove any data posted.</p><p>No party may aggregate, package, spider, collect, display any of the content on this site without the express written consent of AGN</p><p><strong>Copyrights and Trademarks</strong></p><p>This Career Center is copyrighted as a collective work, and individual works appearing on or accessible through this Career Center are likewise subject to copyright protection. You agree to honor the copyrights in this site (including the selection, coordination and arrangement of the contents of this site) and in the works available on or through this site. You may download and maintain single copies of designated materials for your personal use only or as directed in any separate partnership/affiliate agreement with AGN.</p><p>In addition, trademarks and trade dress belonging to AGN or to others appear on or are accessible through the Career Center. The fact that AGN has permitted you access to this Career Center does not constitute authorization to reproduce AGN or any other trademarks or trade dress for any other purpose.</p><p>By submitting any material to AGN, such as posting a comment to a discussion group, or by sending AGN an email, You are thereby granting to AGN a non-exclusive, royalty free, license to use, reproduce, display, distribute, modify and create derivative works from such material and market the fact You were the author of such material.</p><p><strong>Disclaimers and Limitations of Warranties</strong></p><p>AGN makes no guarantees as to the accuracy or truthfulness of any data posted on the Career Center. Any damage you incur by your reliance upon this information is not the responsibility of AGN or its affiliates or partners. By using this Career Center, You assume all responsibility for and risk arising from your use of and reliance upon the contents of this Career Center.</p><p>References and links to products and services belonging to third parties are provided for your convenience and do not represent an endorsement by AGN of such products or services. Materials accessible from or added to this Career Center site by third parties, including, though not limited to, job listings or comments posted in discussion groups, are strictly the responsibility of the third party who added such materials or made them accessible. While AGN reserve the right to monitor third-party discussions and to remove materials that AGN believes are inappropriate. AGN neither endorses nor undertakes to control, monitor, edit or assume responsibility for any such third-party material.</p><p>You assume all liabilities and risks associated with your interaction with individuals You come into contact with through the usage of the services accessible through the Career Center. AGN does not have the means to ensure that everyone is who they claim to be. We make no guarantees as to the legitimacy or accuracy of any job postings, resumes, profile or any type of postings through the Career Center web site. Therefore you agree to release AGN and their respective affiliates and partners from any damages or liability arising out of your usage of the Career Center, or its services.</p><p><br></p><p>THIS CAREER CENTER AND ITS CONTENTS ARE PROVIDED \"AS IS.\" AGN DISCLAIMS ALL WARRANTIES, EXPRESS AND IMPLIED, INCLUDING THE IMPLIED WARRANTIES OF MERCHANTABILITY AND OF FITNESS FOR A PARTICULAR PURPOSE WITH RESPECT TO ANY INFORMATION CONTAINED ON, ACCESSIBLE THROUGH OR DERIVED BY YOU FROM THE CAREER CENTER SITE AND WITH RESPECT TO ANY PRODUCTS OR SERVICES PURCHASED BY YOU THROUGH THE CAREER CENTER. AGN DISCLAIMS ANY AND ALL LIABILITY TO YOU ARISING OUT OF INTERRUPTION OR DAMAGE TO YOUR COMPUTER SYSTEM OR SOFTWARE AS THE RESULT OF ACCESSING OR OTHERWISE USING THE CAREER CENTER. AGN NEITHER WARRANTS NOR REPRESENTS THAT THE SERVICES OR INFORMATION AVAILABLE THROUGH THE CAREER CENTER WILL ENABLE YOU TO ACHIEVE ANY PARTICULAR RESULT OR OUTCOME, LEGAL, ECONOMIC, EDUCATIONAL, OR OTHERWISE. AGN WILL NOT BE LIABLE FOR ANY INCIDENTAL, INDIRECT, CONSEQUENTIAL, OR SPECIAL DAMAGES OF ANY KIND, INCLUDING LOST REVENUES, LOST PROFITS, OR LOSS OF DATA ARISING OUT OF YOUR USE OF THIS SITE. IN THE EVENT THAT ANY OF THE FOREGOING LIMITATIONS AND DISCLAIMERS IS INEFFECTIVE, YOU AGREE THAT OUR MAXIMUM LIABILITY TO YOU SHALL BE THE AMOUNT LISTED IN SECTION \"LIABILITY LIMITATION\".</p><p><br></p>');
